import { defineStore } from "pinia";
import { reqAddressInfo } from "@/api";
export default defineStore('trade', {
    state: () => {
        return {
            address: []
        }
    },
    getters: {

    },
    actions: {
        getAddress() {
            reqAddressInfo().then(
                res => this.address = res.data
            )
        }
    }
})
